  false,\n\t\"url\": null,\n\t\"notes\": \"The standardized NEFSC Atlantic Surfclam
  and Ocean Quahog Survey has covered an area from Cape Hatteras to Georges Bank.
  \ The survey was conducted every two or three years and currently, a subset of the
  survey area is completed annually, with the entire survey area completed every three
  years.  The dredge had been operated in a consistent fashion using the same survey
  protocols and gear from 1982 until 2011.  In 2012, the platform was changed to an
  industry vessel, which resulted in a gear change from a 5' hydraulic dredge to a
  13' commercial style hydraulic dredge. Five-minute tows are made at stations that
  are randomly selected to provide unbiased abundance measurements.  Station data
  includes: shipboard sensors, including ship speed and position, dredge angle, voltage
  and amperage of electrical current that powers the pump on the dredge (through 2011),
  manifold pressure, water depth and temperature.  Biological data includes:  catch
  weight, catch number, lengths, weights, and meat weights.n\",\n\t\"license_title\":
